import React, {useEffect, useState} from "react";

const Privacy =() => {

    const [user, setUser] = useState({})
    const [users, setUsers] = useState([])
    // const [serverUser, setServerUser] = useState({username:"", password:""})





    return (

        <div>

            <h1>Privacy Policy</h1>
            <h3 className="float-left">Data we collect</h3>
            <p>
                Profile Information
                When you create an account on MiniYelp, we only need your username and your password. You may choose to give us more information in your Profile, such as the first name, last name, and email address you enter. We may publicly display the first name and last name that you provide.

                Reviews
                If you are registered as a customer, you may post reviews regarding a business. We will collect your reviews including your rating and comment, and publicly display them along with your username.

                Businesses
                If you are registered as a business owner, you may choose to create your own business. You will need to provide the business title and type, which we will collect from you.
            </p>
        </div>
    )



}

export default Privacy
